//SPDX-License-Identifier: MIT

pragma solidity ^0.8.2;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

//AleSmartContract is the smart contract's name
contract Tiles is ERC721Enumerable, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    //setting max supply
    uint256 public maxSupply = 10;
    //added mintingLocked variable
    bool public mintingLocked;

    //Firt parameter is the collection's name
    //Second parameter is the token's name?
    constructor() ERC721("Tiles", "TILE") {}

    mapping(uint256 => string) tokenURIs;

    function mint(address player, string memory mytokenURI)
        public
        onlyOwner
        returns (uint256)
    {
        uint256 totalSupply = totalSupply();
        //require(_tokenIds.current() < maxSupply, "Max Supply Reached");
        require(totalSupply < maxSupply, "Max Supply Reached");
        uint256 newItemId = totalSupply;
        _mint(player, newItemId);
        tokenURIs[newItemId] = mytokenURI;
        return newItemId;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        return tokenURIs[tokenId];
    }

    function walletOfHolder(address _holder)
        public
        view
        returns (uint256[] memory)
    {
        uint256 ownerTokenCount = balanceOf(_holder);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_holder, i);
        }
        return tokenIds;
        //retorma um ARRAY
    }

    function asd() public view returns (uint256[] memory) {
        return totalTokens();
    }

    function urisOfHolder(address _holder)
        public
        view
        returns (string[] memory)
    {
        uint256 ownerTokenCount = balanceOf(_holder);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        string[] memory URIs = new string[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_holder, i);
            URIs[i] = tokenURI(tokenIds[i]);
        }
        return URIs;
        //retorma um ARRAY
    }

    function lockMinting() public {
        require(
            msg.sender == owner(),
            "You can't lock. You are not owner of the contract"
        );
        mintingLocked = true;
    }

    function burn(uint256 tokenId) public {
        require(
            msg.sender == ERC721.ownerOf(tokenId),
            "Owner should only be able to burn"
        );

        _burn(tokenId);
    }
}
